import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { NavDropdown } from "react-bootstrap";
import Homepage from "../homepage/Homepage";
import { Link } from "react-router-dom";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

function NavBar() {
  return (
    <>
      <Navbar fixed="top" bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="/">MyEvent.ro</Navbar.Brand>
          {/* 
          <Nav.Item>
            <Link to="/">MyEvent.ro</Link>
          </Nav.Item> */}

          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <NavDropdown title="Concerte" id="basic-nav-dropdown">
              <NavDropdown.Item>
                {" "}
                <Link to="/muzicapop"> Pop </Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                {" "}
                <Link to="/muzicarock">Rock</Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                {" "}
                <Link to="/muzicabluescountryfolk">Blues, Country, Folk</Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                {" "}
                <Link to="/muzicajazz">Jazz</Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                {" "}
                <Link to="/muzicareggaesoulhiphop">Reggae, Soul, Hip Hop</Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                <Link to="/muzicaclasica">Muzica Clasica </Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                {" "}
                <Link to="/muzicapopulara">Muzica Populara</Link>
              </NavDropdown.Item>
            </NavDropdown>

            <NavDropdown title="Evenimente Culturale" id="basic-nav-dropdown">
              <NavDropdown.Item>
                <Link to="/teatru"> Teatru</Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                {" "}
                <Link to="/operaopereta">Opera, Opereta </Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                {" "}
                <Link to="/baletdanscabaret">Balet, Dans, Cabaret</Link>
              </NavDropdown.Item>
            </NavDropdown>

            <NavDropdown title="Alte Evenimente" id="basic-nav-dropdown">
              <NavDropdown.Item>
                {" "}
                <Link to="spectacolepentrucopii">Spectacole pentru Copii </Link>
              </NavDropdown.Item>
              <NavDropdown.Item href="/standupcomedy">
                <Link to="/standupcomedy">Stand up Comedy</Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                <Link to="expozitiivernisaje">Expozitii, Vernisaje </Link>
              </NavDropdown.Item>
              <NavDropdown.Item>
                <Link to="evenimentesportive">Evenimente Sportive</Link>
              </NavDropdown.Item>
            </NavDropdown>

            {/* SearchBar */}
            <div class="d-flex flex-row-reverse">
              <Form className="d-flex">
                <Form.Control
                  type="search"
                  placeholder="Search"
                  className="me-3"
                  aria-label="Search"
                />
                <Button variant="outline-success">Search</Button>
              </Form>
            </div>
          </Nav>
        </Container>
      </Navbar>
    </>
  );
}
export default NavBar;

